import React from "react";
import {Box} from "@mui/material";
import theme from "../utils/theme";
import Logo from "../static/image/Logo.png";

const Footer = ()=>{
  return <Box maxWidth="lg" height="374px" bgcolor={theme.color.primary} p="1rem" m='0 auto'>
    <Box display="flex" flexDirection="row" justifyContent='center' alignItems='center' width='100%' height='100%'>
      <Box flex={1} display='flex' flexDirection='row'>
        <Box flex={2} display='flex' alignItems='center' justifyContent='center'>
          <img style={{ backgroundColor: 'white', borderRadius: '100%', border: '1px solid darkgreen' }} src={Logo} alt="logo" width={80} height={80} />
        </Box>
        <Box flex={8} display='flex' flexDirection='column' alignContent='center' justifyContent='center' gap='1rem'>
          <Box color='white'>Location: 1 Kingfisher St, Lidcombe NSW 2141 </Box>
          <Box color='white'>Contacter: 61-410466077</Box>
          <Box color='white'>Email: admin@irisbakeing.com</Box>
        </Box>
      </Box>
      <Box flex={1}>Right container</Box>
    </Box>
  </Box>

} 

export default Footer;
